function isCC(point, points){
    var n=points.length;
    var A=[];
    var b=[];
    var c=[];
    
    var row1=[];
    var row2=[];
    var row3=[];
    var row4=[];
    var row5=[];
    var row6=[];
    
    for(var i=0;i<n;i++){
        row1.push(points[i][0]);
        row2.push(points[i][1]);
        row3.push(-points[i][0]);
        row4.push(-points[i][1]);
        row5.push(1);
        row6.push(-1);
    }
    A.push(row1);
    A.push(row2);
    A.push(row3);
    A.push(row4);
    A.push(row5);
    A.push(row6);
    epsilon=0.01;
    b.push(point[0]+epsilon);
    b.push(point[1]+epsilon);
    b.push(-point[0]+epsilon);
    b.push(-point[1]+epsilon);
    b.push(1+epsilon);
    b.push(-1+epsilon);
    
    for(var i=0;i<n;i++){
        var row=[];
        for(var j=0;j<n;j++){
            if(i===j){
                row.push(-1);                
            }
            else{
                row.push(0);
            }
            
        }
        A.push(row);
        b.push(0);
        c.push(0);
    }
    
    sol = numeric.solveLP(c,                   /* minimize [1,1]*x                */
                        A, /* matrix of inequalities          */
                        b                 /* right-hand-side of inequalities */
                        );  
                
   
    if(isNaN(sol.solution[0])){
        return false;
    }
    else{
        return true;
    }
}

function generateAsteroid(x,y,size, hp){
      var points=[];
      var children=[];
    
   /* for(var p=0;p<5;p++){
        points.push([Math.floor(Math.random()*2*size),Math.floor(Math.random()*2*size)]);
    }*/
 /*  points.push([0,100]);
   points.push([100,0]);
   points.push([0,0]);*/
   
   
    for(var p=0;p<15;p++){
        var point=[Math.random()*2*size,Math.random()*size*2];
        points.push(point);       
       
    }
    
    var rem_indices=[];
    for(var p=points.length-1;p>=0;p--){
        var ps2=[];
        for(var pp=0;pp<points.length;pp++){
            if(pp===p){
                continue;
            }
            ps2.push(points[pp]);
        }
        if(inConvexHull(points[p],ps2)){
            rem_indices.push(p);
        }
    }
  
    for(var r=0;r<rem_indices.length;r++){
        ri=rem_indices[r];
        points.splice(ri,1);
    }
    var centerX=0;
    var centerY=0;
  
    for(var p=0;p<points.length;p++){
        centerX+=points[p][0];
        centerY+=points[p][1];
    }
    
    centerX/=points.length;
    centerY/=points.length;
    var radius=0;
   for(var p=0;p<points.length;p++){
      points[p][0]-=centerX;
      points[p][1]-=centerY;
      radius=Math.max(radius, Math.sqrt(Math.pow(points[p][0],2)+Math.pow(points[p][1],2)));
    }
    centerX=0;
    centerY=0;
    
    
    points.sort(function(a, b)
{
    var angle1=0;
    var angle2=0;
    if(a[1]>=0){
        angle1=Math.acos(a[0]/(Math.sqrt(Math.pow(a[0],2)+Math.pow(a[1],2))));
    }
    else{
        angle1=2*Math.PI-Math.acos(a[0]/(Math.sqrt(Math.pow(a[0],2)+Math.pow(a[1],2))));
    }
    if(b[1]>=0){
        angle2=Math.acos(b[0]/(Math.sqrt(Math.pow(b[0],2)+Math.pow(b[1],2))));
    }
    else{
        angle2=2*Math.PI-Math.acos(b[0]/(Math.sqrt(Math.pow(b[0],2)+Math.pow(b[1],2))));
    }
    return angle1-angle2;	
});
    
    var numChildren=Math.floor(Math.random()*1.9+2);
    if(hp===0){
        numChildren=0;
    }
    var angle=Math.random()*Math.PI*2;
    
    for(var i=0;i<numChildren;i++){
        var child=generateAsteroid(x,y,size*0.7, hp-1);
        child.dx=(Math.random()/2+0.5)*Math.cos(angle);
        child.dy=(Math.random()/2+0.5)*Math.sin(angle);
        angle+=Math.PI*2/numChildren;
        children.push(child);
    }
    
   
   var asteroid= {x:x, y:y, points:points, rotation:Math.random()*Math.PI*2,
       dx:Math.random()-0.5, dy:Math.random()-0.5, spin:(Math.random()-0.5)/40,
       size:radius, centerX:centerX, centerY:centerY, hp:hp, children:children,
       extraDX:0, extraDY:0
   };
   return asteroid;
}

function colisionAsteroids(ast1, ast2){
    //check ball colision:
    if(Math.sqrt(Math.pow(ast1.x-ast2.x, 2)+Math.pow(ast1.y-ast2.y,2))>ast1.size+ast2.size){
      
        return false;  
    }
    
    for(var i=0;i<ast1.points.length;i++){        
        if(collBallAst(ast1.points[i][0]+ast1.x,ast1.points[i][1]+ast1.y,0,ast2)){
           return true; 
        }
    }
    for(var i=0;i<ast2.points.length;i++){        
        if(collBallAst(ast2.points[i][0]+ast2.x,ast2.points[i][1]+ast2.y,0,ast1)){
           return true; 
        }
    }
    
    return false;
    
}

function collBallAst(ballX,ballY,r,ast){
     if(Math.sqrt(Math.pow(ast.x-ballX, 2)+Math.pow(ast.y-ballY,2))>ast.size+r){      
        return false;  
    }   
   
    
    for(var i=0;i<ast.points.length-1;i++){
        var bx=ballX-ast.x;
        var by=ballY-ast.y;
        var p1=ast.points[i];
        var p2=ast.points[i+1];
        if(p1[0]===p2[0]){
            if ((p1[0]>0 && bx>=p1[0]) || (p1[0]<=0 && bx<=p1[0] )){
                
                return false;
                
            }
        }
        else{
            var a=(p2[1]-p1[1])/(p2[0]-p1[0]);
            var b=p1[1]-p1[0]*a;
            var isUnder1=false;
            var isUnder2=false;
            if(ast.centerY<=ast.centerX*a+b){
                isUnder1=true;
            }
            if(by<=bx*a+b){
                isUnder2=true;
            }
            if(isUnder1!==isUnder2){
                
                return false;
                
            }
        }
        
    }
   
    return true;
}

